impl Solution {
    pub fn good_subsetof_binary_matrix(grid: Vec<Vec<i32>>) -> Vec<i32> {
        let m = grid.len();
        let n = grid[0].len();
        let mut result = Vec::new();

        'outer: for mask in 1..(1 << m) {
            let mut sum = vec![0; n];
            let mut rows = Vec::new();
            for i in 0..m {
                if mask & (1 << i) != 0 {
                    rows.push(i as i32);
                    for j in 0..n {
                        sum[j] += grid[i][j];
                    }
                }
            }
            let k = rows.len();
            for col_sum in sum {
                if col_sum > k as i32 / 2 {
                    continue 'outer;
                }
            }
            if rows.len() > result.len() {
                result = rows;
            }
        }

        result.sort_unstable();
        result
    }
}
